import React from 'react';
import { v4 as uuidv4 } from 'uuid';
import plusIcon from '../../imgs/icons/plusIcon.png';

export default function AddCustomFields({ addCustomToFieldsFormState }) {
    const obj = {
        _id: uuidv4(),
        desc: 'Custom Field Name',
        value: '',
        position: 1,
        show: true,
        custom: true,
    };
    return (
        <fieldset className='tile'>
            <legend>
                <b>Add custom fields to your form.</b>
            </legend>
            <button
                className='btn btn--grey'
                onClick={() => addCustomToFieldsFormState(obj)}
            >
                <img src={plusIcon} alt='' />
                Add
            </button>
        </fieldset>
    );
}
